import React from "react";
import {
  Button,
  Container,
  Form,
  Nav,
  Navbar,
  NavDropdown,
} from "react-bootstrap";

function Navbars() {
  return (
    <div>
      <Navbar expand="lg" className="bg-body-tertiary">
        <Container fluid>
          <Navbar.Brand href="/">
            <img src="/images/logo1.jpg" alt="logo" />
          </Navbar.Brand>
        </Container>
      </Navbar>
    </div>
  );
}

export default Navbars;
